import React from 'react'
import './Home.scss'
import p1 from '../../thumbs/p1.jpg'
import p2 from '../../thumbs/p2.jpg'
import p3 from '../../thumbs/p3.jpg'
import p4 from '../../thumbs/p4.jpg'
import p5 from '../../thumbs/p5.jpg'
import p6 from '../../thumbs/p6.jpg'
import p7 from '../../thumbs/p7.jpg'
import p8 from '../../thumbs/p8.jpg'
import p9 from '../../thumbs/p9.jpg'
import p10 from '../../thumbs/p10.jpg'
import p11 from '../../thumbs/p11.jpg'
import p12 from '../../thumbs/p12.jpg'
import p13 from '../../thumbs/p13.jpg'
import p14 from '../../thumbs/p14.jpg'
import p15 from '../../thumbs/p15.jpg'
import logo from '../../img/logo.png'

export default function Home() {

  const automation_showcase = [
    {
      img: p1,
      title: 'Water Treatment Overview'
    },
    {
      img: p2,
      title: 'Waste Water Treatment Plant'
    },
    {
      img: p3,
      title: 'Desalination'
    },
    {
      img: p4,
      title: 'Oil & Gas'
    },
    {
      img: p5,
      title: 'Chemical'
    },
    {
      img: p6,
      title: 'Airport Baggage Handling'
    },
    {
      img: p7,
      title: 'PLC Panel'
    },
    {
      img: p8,
      title: 'Motor Control Center'
    },
    {
      img: p9,
      title: 'Control Panel'
    },
    {
      img: p10,
      title: 'Panel Layout'
    },
    {
      img: p11,
      title: 'Wiring Schematics'
    },
    {
      img: p12,
      title: 'Interconnection Drawings'
    },
    {
      img: p13,
      title: 'RS Logix Ladder'
    },
    {
      img: p14,
      title: 'GE Versapro Ladder'
    },
    {
      img: p15,
      title: 'C, Ladder & Automation Basic - B&R PLC'
    },
  ]
  return (
    <div className="Home">
      <div className="left">
        <h2>SUCCESS STORIES</h2>
        <div className="links">
          <a href="/"><span className="span">INDUSTRIAL AUTOMATION</span></a>
          <a href="/"><span className="span">3D MODELING & PIPING</span></a>
          <a href="/"><span className="span">DETAIL ENGINEERING</span></a>
          <a href="/"><span className="span">CUSTOM DESIGN</span></a>
          <a href="/"><span className="span">SCRUBBING SYSTEM</span></a>
          <a href="/"><span className="span">COLUMN INTERNALS</span></a>
        </div>
        <div className="logo">
          <img src={logo} alt="" />
          <span>TRANS TECH PROJECTS PVT. LTD.</span>
        </div>
        <div className="contact-details">
          <h3>ADDRESS</h3>
          <span>Plot No.17, Sr .No.13,
            Near Bramha Chaitnya Society,
            Vidnyan Nagar Road,
            Bavdhan, Pune, Maharashtra - 411021, INDIA.</span>

          <h3>TELEPHONE</h3>
          <span>+ 91-8983002534,</span>
          <span>+ 91-8983008534,</span>
          <span>+ 91-8446008660</span>

          <h3>E-Mail</h3>
          <span>info@transtechprojects.com</span>
        </div>

      </div>
      <div className="right">
        <h2>INDUSTRIAL AUTOMATION</h2>
        <div className="img-container">
          {automation_showcase.map((img) => {
            return <div className="box" key={img.title}>
              <img src={img.img} alt="" />
              <span>{img.title}</span>
            </div>
          })}
        </div>
      </div>
    </div>
  )
}
